// SPDX-License-Identifier: UNLICENSED

pragma solidity >=0.4.22 <0.9.0;

contract Token{
  int8 count;
event payedSuccess(string);
  function doIncrement() public {
      count+=1;
  }
  function doDecrement() public  {
      count-=1;
  }
  function getCount() public  view returns (int8){
      return count;
  }
    function payToOtherAccount(address payable  receiverAccount  ) public  payable  {
         receiverAccount.transfer(msg.value);
         emit payedSuccess("successfully transferd");
     }
}

